--
-- 資料表結構 `stock`
--

CREATE TABLE `stock` (
  `id` int(10) UNSIGNED NOT NULL,
  `sort` int(11) NOT NULL,
  `stockname` varchar(50) DEFAULT NULL COMMENT '股票名',
  `stockno` varchar(50) NOT NULL COMMENT '股票號',
  `networthdata` mediumtext DEFAULT NULL COMMENT '淨值資料',
  `stockdata` mediumtext DEFAULT NULL COMMENT '股票資料_日',
  `yielddata` mediumtext DEFAULT NULL COMMENT '殖利率資料',
  `threecargo` mediumtext DEFAULT NULL COMMENT '法人買賣超和融資融劵',
  `holder` mediumtext DEFAULT NULL COMMENT '股東持股分級週統計圖',
  `updated_at` timestamp NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp()
